script: |
  super -f text -I q5326.spq | sort > q5326.out

inputs:
  - name: q5326.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + col1 NOT IN ( + col2 + - col2 * col1 * + + 14 / - + col2 + + + col0, - 88 / + - 69 * + col2 );
  - name: tab2

outputs:
  - name: q5326.out
    data: |
